import "./contact.scss";

export default function Contact() {
    return (
        <div className="contact" id="contact">
            <div className="left">
                <img src="assets/shake.svg" alt="logo_svg" />
            </div>
            <div className="right">
                <h2>Contact.</h2>
                <form action="">
                    <input type="email" name="email" id="email" placeholder='Courriel' />
                </form>
            </div>
        </div>
    )
}
